      | 364041 -> { ItemTypeData.id= 364041; name= "Sentinel gk.0"; published= false; description= "The Sentinel dropsuit is a second-generation solution designed to withstand concentrated small arms fire and protect the wearer from the concussive, thermal, and impact forces of low-grade explosives. Additionally, its power-assisted exoskeleton facilitates usage of the heaviest caliber personal weapons.    Enhanced to withstand kinetic and fragmentary impacts with minimal deformation, Gallente Sentinel technology offers the best armor protection currently available in the cluster. Ablative surfacing helps deflect incoming fire and ultra-efficient armor composites and electrically charged active protection plates increase survivability in even the most dangerous combat situations.    Heavy dropsuits lack the mobility of lighter suits, but this trade-off results in a defensive system that defies standard infantry conventions. No other classification of personal armor can claim to be able to stand toe-to-toe with enemy vehicles and survive."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 364332 -> { ItemTypeData.id= 364332; name= "Staff Recruiter Sniper Rifle"; published= false; description= "Using microscale railgun technology, the sniper rifle effectively weaponizes velocity, putting an inert round downrange in excess of 2,500m/s. The standard round is a 2-inch ‘beehive' flechette, loaded automatically from a center-mount pack. The pack design eliminates user intervention and minimizes reload time while simultaneously allowing for future upgradeability; different ammunition configurations require nothing more than switching out the rifle's pack."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 364817 -> { ItemTypeData.id= 364817; name= "Minmatar Medium Frame M-I"; published= false; description= "A basic dropsuit frame hardwired with all minimum designation combat suites and protocols but without any role-specific customizations.    NOTE: This basic frame does not receive any role-specific bonuses."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365302 -> { ItemTypeData.id= 365302; name= "'Neo' Pilot gk.0"; published= false; description= "The Pilot dropsuit enhances vehicle operability. Using an adaptive synth-nerve network, the suit seamlessly integrates with on-board systems, establishing a cognitive link between the user and the host vehicle. This provides unprecedented control over every aspect of a vehicle’s weapon, navigation, propulsion, and electronic subsystems.    Ill-suited to frontline combat, the Gallente suit instead incorporates a host of structural monitoring nodes, smart I/O channels and energy management controllers into a wearable interface that enhances the performance of the vehicle’s shield and armor subsystems.    In much the same way the capsule revolutionized space flight, the Pilot suit has vastly improved the man-machine interface for planetside vehicles."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
