      | 50052 -> { ItemTypeData.id= 50052; name= "Women's 'Amaranthine Divide' Facial Augmentation"; published= true; description= "Using state-of-the-art nanocoating technology at a very personal level, facial augmentations can be crafted with striking designs that mask the mesh technology that will boost the wearer's somatosensory systems.    Hyper-intensive simulations indicate a more focused and aware connection between an augmented individual's consciousness and their nervous-emotional responses. However, the benefits of this augmentation are not solely limited to improving cognitive interaction with emotional inputs and outputs.    Whether sipping cocktails in the zero-g bars of Caille, or ripping apart the sputtering remains of a pirate vessel with your guns in nullsec, one thing will be certain: those who see your face will have it etched into their memory forever."; marketGroupId= Some(1836); groupId= 1670; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.500000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
